import request from '@/utils/request';
var url = 'v1/IndDeptApply/indDeptApplyInfos';
export function add(data) {
  return request({
    url: url,
    method: 'post',
    data: data
  });
}
export function del(ids) {
  return request({
    url: url,
    method: 'delete',
    data: ids
  });
}
export function edit(data) {
  return request({
    url: url,
    method: 'put',
    data: data
  });
}
export default {
  url: url,
  crud: {
    add: add,
    edit: edit,
    del: del
  }
};
